import React from "react";
import Card from "react-bootstrap/Card";

import "./SubwayStation.css";

// temp mock data for a single station
// needs to be extracted from props
const station = {
  name: "Astor Pl",
  lines: ["4", "5", "6"],
};

const LineInfo = (props) => {
  return (
    <div>
      <Card.Title>{props.lineIndex}</Card.Title>
    </div>
  );
};

const SubwayStation = (props) => {
  return (
    <div className="container">
      <h1 className="stationName">{station.name}</h1>
      <Card>
        <Card.Body>
          <Card.Title></Card.Title>
        </Card.Body>
      </Card>
    </div>
  );
};

export default SubwayStation;
